INSERT INTO `hhs_weixin_keywords` ( `id`, `name`, `keyword`, `type`, `contents`, `pic`, `pic_tit`, `desc`, `pic_url`, `count`, `status` ) VALUES  ('100', '图文消息测试', '图文消息', '2', '', '4.jpg', '图文消息的测试标题', '资料显示，华数集团是由杭州文广集团、浙江广电集团等投资设立的大型国有文化传媒产业集团。在新媒体产业，华数集团旗下控股的上市公司华数传媒控股股份有限公司拥有上百万小时的数字媒体内容库、数千万台互联网电视终端，新媒体全业务运营牌照。', 'http://tech.sina.com.cn/i/2014-04-08/18199305530.shtml', '63', '1');
INSERT INTO `hhs_weixin_keywords` ( `id`, `name`, `keyword`, `type`, `contents`, `pic`, `pic_tit`, `desc`, `pic_url`, `count`, `status` ) VALUES  ('105', '文本消息测试', '文本消息', '1', '近年来，公开选拔和竞争上岗作为干部人事制度改革的重要举措，在拓宽选人视野，打破论资排辈等不少方面积极作用明显。“但走向极端就会出现问题，比如一些地方规定公开选拔和竞争上岗人员必须达到干部任用的多少比例，甚至进一步绝对化为‘凡提必竞’。”中央党校教授辛鸣说。', '', '', '', '', '54', '1');
INSERT INTO `hhs_weixin_lang` ( `lang_id`, `lang_name`, `lang_value` ) VALUES  ('1', 'regmsg', '欢迎关注昊海软件体验拼好货商城，昊海软件专注电商软件开发，开发经验六年载，对三百多家电商企业提供产品服务。拼好货商城又是公司团队开发的一大创新性产品，公司会不断总结，不断和电商企业探讨，精心制作，不端更新，助中小企业赢得商机！咨询电话：029-87888753 13891864749\r\n   \r\n进入 <a href=\"http://pts.hostadmin.com.cn/\">官方商城</a>');
